import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type '#dance'
    await page.waitForSelector('#searchInput', { state: 'visible' });
    await page.fill('#searchInput', '#dance');

    // Take screenshot after filling search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Click search button
    await page.waitForSelector('#searchBtn', { state: 'visible' });
    await page.click('#searchBtn');

    // Wait for potential search results to load
    await page.waitForTimeout(2000);

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract search input value to verify task completion
    const searchValue = await page.$eval('#searchInput', el => el.value);
    const extractedData = {
      searchInputValue: searchValue,
      searchPerformed: searchValue === '#dance'
    };

    return {
      success: true,
      action: "Typed '#dance' in search input and clicked search button",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

